import {BrowserRouter} from 'react-router-dom';

export let rerenderEntireTree = (state) => {
  const root = ReactDOM.createRoot(document.getElementById('root'));
  
  root.render(
    <BrowserRouter>
        
            <App 
                appState={state} 
                addPost={addPost} 
                rewritePostText={rewritePostText} /> 
        
    </BrowserRouter>
  );
};

